import createReactComponent from '../createReactComponent';
var Clock6 = createReactComponent('Clock6', [['circle', {
  cx: '12',
  cy: '12',
  r: '10',
  key: '1mglay'
}], ['polyline', {
  points: '12 6 12 12 12 16.5',
  key: 'hb2qv6'
}]]);
export default Clock6;
